import Layout from "../components/MyLayout.js";

const Gear = () => {
  return (
    <Layout>
      <p>My Ridiculously expensive gear page</p>
      <style jsx>{`
        p { color : white ;}
        `}</style>
    </Layout>
  );
}
export default Gear;
